import './contact.scss';
const contact = ()=>{
    return(
        <>
            <div className="body">
                <div className="ContentInside">
                    <Head title="A propos | 6 solutions" />
                    <Header active="propos"/>
                    <div className="proposBody">
                        <h1 className="title">Contacts</h1>
                        <div className="shape"></div>
                    </div>
                </div>
            </div>
            <Footer/>
        </>
    )
}
export default contact ;
